e to your office, client\'s home or place of business. Professional appearance, courteous and always on time.\r\n\r\nWhy Use Kathryn Clare Brock \r\nFor Your Loan Signings?\r\n\r\nPromptness, Presentation, and Professionalism \r\n\r\nKathryn Clare Brock takes pride in being prompt for appointments and takes the time to present the loan package to the borrower in a professional manner. \r\n\r\nCritical documents are reviewed first so that any concerns the borrower may have can be resolved in a timely manner. The critical documents are: \r\n\r\nGovernment Issued ID â€“ Borrowerâ€™s identification is verified, and the name on the ID matches the name on the loan documents.\r\n\r\nSettlement Statement (HUD) â€“ Review the settlement charges, payoffs, loan amount, credits and amount being disbursed to or owed by the borrower. Collect funds due (if applicable)\r\n\r\nNote â€“ Verify property address, loan amount, lender, interest rate, payment due dates, where payments are to be mailed, monthly payment amount (principle and interest only), and the percentage rate charged by the lender if payment is late, as well as what happens if the borrower defaults on the Note. \r\n\r\nDeed of Trust â€“ The borrower will be made aware that this is the â€œsecurity instrumentâ€ which gives the lender a claim against the borrowerâ€™s home if they fail to live up to the terms of the note, and the borrower will verify that vesting of the borrowerâ€™s name, property address, county, and loan amount are all correct.\r\n\r\nNotice of Right to Cancel â€“ The borrower will be made aware that there are three full business days to review the loan package and resolve any issues that may arise.\r\n\r\nImpound/Escrow Account and the Initial Escrow Account Disclosure Statement â€“ If the borrower has requested an escrow account be set up, it will be pointed out that the Note shows principal and interest only and that the escrow account breaks down the taxes and insurance and is in addition to the principle and interest, there by bringing the actual monthly payment up to â€œxâ€ amount. \r\n\r\nTruth-in-Lending Disclosure Statement â€“ Review of all charges associated with the loan over the life of the loan. The borrower will be made aware of the Annual Percentage Rate, total number of payments, and any prepayment penalties that may be indicated.\r\n\r\nOf course there are many other documents that are included in a loan package; however these are the major ones. Any concerns that arise during the signing process will usually occur on these documents. Once the loan package is signed and complete, it will be reviewed before leaving the table to verify that nothing has been missed, again reviewed in my car before leaving the borrowers home, and then promptly returned by overnight courier.\r\n\r\nI am a California Certified Notary Signing Agent with over 1,000+ transactions. I will meet the client at his/her home, place of business or any other agreed upon location. I GUARANTEE my work! I accept documents by Email, E-fax, FedEx or Pickup. I will return your documents within 24hrs if local and within less than 48 hrs if not. Give me a try, you will happy you did!\r\n\r\nI WANT TO BE YOUR NOTARY LOAN SIGNING AGENT\r\n\r\nYou\'ve worked hard to put the loan together, so let\'s get it signed and closed with my professional detail-oriented Notary Loan Signing Service. \r\n\r\nSincerely,\r\nKathryn Clare Brock',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(32143,32208,'Ryan','Littleton','Five Star Enterprises LLC','(606) 776-5157','(606) 780-9960','(606) 207-4335','','(606) 780-9960','85','115','100','125','358557','10/09/2011','Yes','$30000-$35000','2/03/2012','720 Bratton Road','Morehead','KY','40351','720 Bratton Road','Morehead','KY','40351','Ryan Littleton','720 Bratton Road','Morehead','KY','40351','Yes','No','Letter','No','No','3-5 Years','Yes','50-100','No','Yes','Spanish',NULL,NULL,NULL,NULL,NULL,'No',NULL,'2011-03-22 11:23:03','2011-03-22 11:37:07','0','',NULL,NULL,NULL